import React from "react";
import Log from "./Log";
import { Routes, Route } from "react-router-dom";
import Nav from "./Nav";
import Home from "./Home";
import Bgmi from "./Bgmi";
import FF from "./FF";
import Pr from "./Pr";
function App() {
  return (
    <>
      <Nav />
      <Routes>
        <Route path="/" element={<Log />}></Route>
        <Route element={<Pr />}>
          <Route path="/home" element={<Home />}></Route>
          <Route path="/bgmi" element={<Bgmi />}></Route>
          <Route path="/ff" element={<FF />}></Route>
          <Route path="/um" element={<Um />}></Route>
        </Route>
      </Routes>
    </>
  );
}
export default App;
